import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-search-flights',
  templateUrl: './search-flights.component.html',
  styleUrls: ['./search-flights.component.css']
})
export class SearchFlightsComponent implements OnInit {
    ngOnInit(): void {
        throw new Error('Method not implemented.');
    }

  constructor() { }

  SearchResults: FlightRm[] = [
    {
      airline : "American Airlines",
      remainingNumberOfSeats: 15,
      departure: { place: "Los Angelos", time: Date.now().toString() },
      arrival: { place: "Istanbul", time: Date.now().toString() },
      price: "500"
    },
    {
      airline: "British Airlines",
      remainingNumberOfSeats: 125,
      departure: { place: "London", time: Date.now().toString() },
      arrival: { place: "Paris", time: Date.now().toString() },
      price: "50"
    },
    {
      airline: "Fly Emirates",
      remainingNumberOfSeats: 115,
      departure: { place: "Dubai", time: Date.now().toString() },
      arrival: { place: "Lebanon", time: Date.now().toString() },
      price: "100"
    },
    {
      airline: "Australian Airlines",
      remainingNumberOfSeats: 215,
      departure: { place: "Dublin", time: Date.now().toString() },
      arrival: { place: "New York", time: Date.now().toString() },
      price: "5100"
    }

  ]
    
}

export interface FlightRm {
  airline: String;
  arrival: TimePlaceRm;
  departure: TimePlaceRm;
  price: String;
  remainingNumberOfSeats: number;
}

export interface TimePlaceRm {
  place: string;
  time: string;
}
